import './App.css';
import Navbar from './Navbar'
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.min.js';
import Couple from './img/yeniev.jpeg'

function App() {
  return (
    <div className="App">
      <Navbar/>
      <img style={{height: '90%', width: '100%'}} src={Couple} alt="img"/>
      <form class="d-flex" style={{position: 'relative', bottom: '500px', left: '35%', height: '20%', width: '34%', zoom: '1.4'}}>
        <input class="form-control me-2" type="search" placeholder="Enter an address, neigborhood, city, or ZIP code" aria-label="Search"/>
        <button class="btn btn-success" type="submit">Search</button>
      </form>
    </div>
  );
}

export default App;
